import { Card, Avatar } from "antd";

const UserProfile = () => {
  return (
    <>
      <Card acttion={[
        <div key>냠냠 <br></br></div>
      ]}>
        <Card.Meta avatar={<Avatar>SECHO</Avatar>} title="secho" />
      </Card>
    </>
  );
};

export default UserProfile;
